import styled from 'styled-components';
import {PageWrap} from '../../components/common/styled'
import Header from '../../components/common/header'
import {MdOutlineArrowDropDown} from 'react-icons/md'
const Exploring = () => {
  return (
    <PageWrap>
      <Header />
      <CompanyListBox>
        <CompanyListCenter>
          <CompanyFilterBox>
            <FilterLiftBox>
              <TagFilterBtn><BtnTitle>태그</BtnTitle><TagText>딱 맞는 기업 찾기</TagText><ArrIcon /></TagFilterBtn>
              <FilterBtn><BtnTitle>지역</BtnTitle><FilterText>서울 외</FilterText><ArrIcon /></FilterBtn>
              <FilterBtn><BtnTitle>경력</BtnTitle><FilterText>신입</FilterText><ArrIcon /></FilterBtn>
            </FilterLiftBox>
            <FilterRightBox></FilterRightBox>
          </CompanyFilterBox>
        </CompanyListCenter>
      </CompanyListBox>
    </PageWrap>
  )
}

const CompanyListBox = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`
const CompanyListCenter = styled.div`
  max-width: 1060px;
  width: 100%;
  display: flex;
  flex-direction: column;
  padding: 20px 0 80px;
`
const CompanyFilterBox = styled.div`
  top: 50px;
  margin-bottom: 19px;
  padding-top: 10px;
`
const FilterLiftBox = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: left;
  align-items: center;
`
const FilterRightBox = styled.div`
`
const TagFilterBtn = styled.button`
  -webkit-box-align: center;
  align-items: center;
  display: inline-flex;
  height: 40px;
  padding: 0 39px 0 15px;
  margin-bottom: 0;
  border-radius: 5px;
  border: 1px solid #ececec;
  position: relative;
`
const FilterBtn = styled.button`
  -webkit-box-align: center;
  align-items: center;
  display: inline-flex;
  height: 40px;
  padding: 0 39px 0 15px;
  margin-bottom: 0;
  border-radius: 5px;
  border: 1px solid #ececec;
  position: relative;
  margin-left: 10px;
`
const ArrIcon = styled.span`
  content: "";
  top: 50%;
  right: 16px;
  width: 0;
  height: 0;
  position: absolute;
  z-index: 99;
  border-top: 6px solid #333;
  border-left: 4px solid transparent;
  border-right: 4px solid transparent;
  -webkit-transform: translateY(-50%);
  transform: translateY(-50%);
`
const BtnTitle = styled.div`
  font-size: 14px;
  font-weight: 400;
  letter-spacing: normal;
  color: #333;
  margin-right: 8px;
  white-space: nowrap;
`
const TagText = styled.span`
  color: #999;
  font-weight: 400;
`
const FilterText = styled.span`
  color: #36f;
  font-weight: 600;
  margin-right: 0;
  overflow: hidden;
  text-overflow: ellipsis;
`


export default Exploring;
